@use "fonts.scss";
@use "skils.scss";

* {
    padding: 0;
    margin: 0;
    font-weight: 300;
    list-style: none;
    text-decoration: none;
}

h1,
h2,
h3,
h4,
h5,
h6 {
    text-transform: uppercase;
}

html,
body {
    font-family: "Quicksand", sans-serif;
}

body #root {
    display: grid;
    grid-template-columns: 1.5fr 1fr 1fr 1.5fr;
    height: 100vh;

    @media screen and (max-width: 1200px) {
        height: unset;
        grid-template-columns: 1fr 0.5fr 1fr;
        grid-template-rows: 1fr 1fr;
    }

    @media screen and (max-width: 550px) {
        grid-template-columns: 1fr;
        grid-template-rows: 30vh 1fr 1fr 1fr;
    }
}

#left {
    padding: 60px 30px 60px 60px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    @media screen and (max-width: 1200px) {
        grid-area: 1 / 1 / 2 / 3;
    }

    @media screen and (max-width: 550px) {
        grid-area: unset;
        padding: 10%;
    }

    h1 {
        font-size: 48px;
        line-height: 45px;
    }

    ul {
        margin-bottom: 10px;
    }

    .last {
        margin-bottom: 3%;
    }
}

#left-center {
    background: url(../img/desktop.jpg) no-repeat center;
    background-size: cover;

    @media screen and (max-width: 1200px) {
        grid-area: 1 / 3 / 2 / 4;
    }

    @media screen and (max-width: 550px) {
        grid-area: 1 / 1 / 2 / 2;
    }
}

#right-center {
    background-color: rgb(27, 27, 36);
    color: #fff;
    padding: 60px 20px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    @media screen and (max-width: 1200px) {
        grid-area: 2 / 1 / 3 / 2;
    }

    @media screen and (max-width: 550px) {
        grid-area: unset;
        padding: 10%;

        h2 {
            margin-bottom: 8px;
        }

        > div {
            margin-bottom: 5px;
        }
    }

    h2:last-of-type {
        margin-top: 20px;
    }
}

#right {
    padding: 60px 60px 60px 20px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    @media screen and (max-width: 1200px) {
        grid-area: 2 / 2 / 3 / 4;
    }

    @media screen and (max-width: 550px) {
        grid-area: unset;
        padding: 10%;

        h2 {
            margin-bottom: 12px;
        }

        > div {
            margin-bottom: 10px;
        }
    }

    .exp-block {
        display: flex;

        > div:first-child {
            flex: 1 0 88px;
            margin-right: 10px;
        }

        p:nth-child(2) {
            margin-bottom: 10px;
        }
    }

    h2:last-of-type {
        margin-top: 40px;
    }
}
